import React from 'react'
import Button from '@material-ui/core/Button'

export default function NavBar2 (props) {
    const styles = 
    {
        ul: {

        }, 
        button:{
            border: "0.5px solid gray"
        },
        li:{
            display: "inline-block",
            margin: "1rem", 
        }
    }
    return (
        <ul>
            <li style={styles.li}> <Button style={styles.button}>About Me </Button> </li>
            <li style={styles.li}> <Button style={styles.button}> Experience </Button> </li>
            <li style={styles.li}> <Button style={styles.button}> Get Resume </Button> </li>
        </ul>
    )
}
